                @keyframes crystal_ala{
                	0%{
                		opacity: 0;
                	}
                	40%{
                		opacity: 0;
                	}
                	100%{
                		opacity: 1;
                		transform: none;
                	}
                }

                @keyframes crystal{
                	to{
                		transform: none;
                	}
                }

                .ala{
                	transform-origin: 1150px 500px;
				    animation-duration: 1.5s;
				    animation-timing-function: ease-in;
				    animation-iteration-count: infinite;
				    animation-direction: alternate;
				    animation-delay: 2.3s;
				}
				.ala.der{
					animation-name: aleteo_der;
				}
				.ala.izq{
					animation-name: aleteo_izq;
				}

				@keyframes aleteo_der{
					from{
				    	transform: rotateY(0deg);
					}
					to{
				    	transform: rotateY(30deg);
					}
				}
				@keyframes aleteo_izq{
					from{
				    	transform: rotateY(0deg);
					}
					to{
				    	transform: rotateY(-30deg);
					}
				}

				.luces{
					opacity: 0;
					animation: luces 4s forwards;
					animation-delay: 2s;
				}
				@keyframes luces{
					to{
						opacity: 1;
					}
				}
				.text{
                	transform-origin: 1150px 500px;
                	transform: scale(0.9);
					opacity: 0;
					animation: fadeInText 2s forwards;
					animation-delay: 1s;
				}
				@keyframes fadeInText{
					to{
						opacity: 1;
						transform: none;
					}
